import { Link } from 'react-router-dom';

import './index.scss';
import Mylogo from '../../assets/images/my-logo';

export default function Sidebar() {
  return (
  <aside className="nav-bar">
    <Link className="logo" to="/" >
      <img src={ Mylogo } alt="anthony logo" />
    </Link>

  </aside>
  )
}
